import styled from '@emotion/styled';

const ScoreBoard = styled.div`
  display: grid;
  grid-template-columns: 50% 50%;
  grid-template-rows: repeat(3, auto);

  .team1{
    grid-column-start: 0;
    width: 100%;
    text-align: center;

    .scoreButtons{
      width: 300px;
    }
  }
`;

function Home() {
  return(
    <>
      <h1>Basketball Time!</h1>
      <ScoreBoard>
        <div className="team1">
          <h3 className="name">Tom</h3>
          <h2 className="score"></h2>

          <div className="scoreButtons">
            <button>3</button>
            <button>2</button>
            <button>1</button>
          </div>
        </div>
      </ScoreBoard>
    </>
  );
}

export default Home;
